import React, { Fragment, useState } from "react";
import { KeyboardDatePicker } from "@material-ui/pickers";
import { MuiPickersUtilsProvider } from "@material-ui/pickers";
import DateFnsUtils from "@date-io/date-fns";
import Grid from "@material-ui/core/Grid";
import Container from "@material-ui/core/Container";
import Button from "@material-ui/core/Button";
import FindInPageIcon from "@material-ui/icons/FindInPage";
import { makeStyles } from "@material-ui/core/styles";
import TextField from "@material-ui/core/TextField";

const useStyles = makeStyles((theme) => ({
  container: {
    display: "flex",
    flexWrap: "wrap",
  },
  textField: {
    marginLeft: theme.spacing(1),
    marginRight: theme.spacing(1),
    width: 200,
  },
}));

function KeyboardDatePickerExample({ date, setDate }) {
  const classes = useStyles();
  const { startdate, enddate } = date;
  const [selectedStartDate, handleStartDateChange] = useState();
  const [selectedEndDate, handleEndDateChange] = useState();
  const onSubmit = () => {
    console.log(selectedStartDate);
    console.log(selectedEndDate);
    const submit = { startdate: selectedStartDate, enddate: selectedEndDate };
    console.log("วันที่", submit);
    setDate({
      ...date,
      submit,
    });
    console.log(date);
  };
  return (
    <Fragment>
      <Container maxWidth="lg">
        <Grid container spacing={1}>
          {/* Chart */}
          <Grid item xs={4} md={4} lg={4}>
            <form className={classes.container} noValidate>
              <TextField
                id="startdate"
                label="วันที่เริ่มต้น"
                type="date"
                name="startdate"
                defaultValue="01/01/2020"
                className={classes.textField}
                InputLabelProps={{
                  shrink: true,
                }}
                onChange={(e) =>
                  handleStartDateChange({
                    ...selectedStartDate,
                    start: e.target.value,
                  })
                }
              />
            </form>
          </Grid>

          <Grid item xs={3} md={3} lg={3}>
            <form className={classes.container} noValidate>
              <TextField
                id="enddate"
                label="วันที่สิ้นสุด"
                name="enddate"
                type="date"
                defaultValue="01/01/2020"
                className={classes.textField}
                InputLabelProps={{
                  shrink: true,
                }}
                onChange={(e) =>
                  handleEndDateChange({
                    ...selectedStartDate,
                    end: e.target.value,
                  })
                }
              />
            </form>
          </Grid>
          <Grid
            item
            xs={4}
            md={4}
            lg={4}
            alignContent="center"
            justify="center"
          >
            <Button variant="outlined" color="primary" onClick={onSubmit}>
              <FindInPageIcon />
              <p>ค้นหาข้อมูล</p>
            </Button>
          </Grid>
        </Grid>
      </Container>
    </Fragment>
  );
}

export default KeyboardDatePickerExample;
